<script>
    export default {
        name:"cursos-component",
        props:['idiomas'],
        mounted() {
            $("path.flag").on("mouseenter mouseleave", function (e) {
                const flag = e.target;
                
                switch(e.type) {
                    case 'mouseenter':
                        document.querySelector(`path.country.${flag.classList[1]}`).setAttribute('fill','#E4032F');
                        document.querySelector(`path.country.${flag.classList[1]}`).setAttribute('stroke','white');
                    break;
                    case 'mouseleave':
                        document.querySelector(`path.country.${flag.classList[1]}`).setAttribute('fill','#FAB500');
                        document.querySelector(`path.country.${flag.classList[1]}`).removeAttribute('stroke');
                    break;
                    default:
                    break;
                }
            });
            let thisComponent = this;
            $("path.country").on('click', function(e) {

                let language = e.currentTarget.dataset.language;
                let idioma = thisComponent.idiomas.find(idioma => idioma.diminutivo === language );
                window.location.href = `/cursos/${idioma.nombreURL}`;
            });
        },
    }
</script>

